client.on('message', async message => {
    const userMessage = message.body.toLowerCase();

    // Find a rule that matches the trigger
    let matchedRule = rules.find(
        (rule) => !rule.isDefault && rule.trigger && userMessage.includes(rule.trigger.toLowerCase())
    );

    // If no specific rule matches, find the default rule
    if (!matchedRule) {
        matchedRule = rules.find(rule => rule.isDefault);
    }
    
    if (matchedRule) {
        const { response } = matchedRule;
        const chat = await message.getChat();

        if (response.type === 'list') {
            const list = new List(
                response.title,
                'בחר',
                [{
                    title: 'בחר מהאפשרויות',
                    rows: response.options.map(opt => ({ title: opt }))
                }]
            );
            client.sendMessage(message.from, list);
        } else if (response.type === 'rich') {
            if (response.media && response.media.data) {
                const media = new MessageMedia(response.media.mimeType, response.media.data);
                client.sendMessage(message.from, media, { caption: response.text });
            } else if (response.buttons && response.buttons.length > 0) {
                const buttons = new Buttons(
                    response.text,
                    response.buttons.map(btn => ({ body: btn })),
                    'תגובה מהירה', // Optional title
                    '' // Optional footer
                );
                client.sendMessage(message.from, buttons);
            } else {
                client.sendMessage(message.from, response.text);
            }
        }
    }
});

client.initialize();
